    [TestClass]
    public class MongoTest
    {
        public const string ConnectionString = "mongodb://localhost:27017/SignatureDb";

        [TestMethod]
        public void TestCRUDCompany()
        {
            MongoContext context = new MongoContext(ConnectionString);
            Storage storage = new Storage(context);
            Company company = new Company()
            {
                Name = "test",
                RegisterDate = DateTime.UtcNow
            };
            var companyRepository = storage.GetRepository<Company>(); 
            companyRepository.Create(company).Wait();
            Assert.IsNotNull(company.Id);

            company.OwnerId = "test";
            companyRepository.Update(company).Wait();
       
            companyRepository.Remove(company.Id).Wait();
        }

        [TestMethod]
        public void TestCRUDCUser()
        {
            MongoContext context = new MongoContext(ConnectionString);
            Storage storage = new Storage(context);
            var companyRepository = storage.GetRepository<Company>();
            var userRepository = storage.GetRepository<User>();
            
            User u = new User
            { 
                Email = "test@email.com",
                FirstName = "test",
                LastName = "test",
                Phone = "+38095488668",
                Password = "test",
                Position = "test",
                RegisterDate = DateTime.UtcNow,
                Role = UserRoles.Admin.ToString()
            };
            userRepository.Create(u).Wait();
            string newValue = "test2";
            u.FirstName = newValue;
            userRepository.Update(u);
            User updated = userRepository.Get(x => x.Id == u.Id).Result;
            Assert.AreEqual(updated.FirstName, newValue);

            userRepository.Remove(updated.Id).Wait();
        }

        [TestMethod]
        public void InitDb()
        { 
            MongoContext context = new MongoContext(ConnectionString);
            context.CreateCollection("Companys").Wait();
            context.CreateCollection("Users").Wait();
            context.CreateCollection("Signatures").Wait();
            context.CreateCollection("FileInfo").Wait();

            Storage storage = new Storage(context);
            var companyRepository = storage.GetRepository<Company>();
            var userRepository = storage.GetRepository<User>();

            Company ownCompany = new Company()
            {
                Name = "Volt Signature",
                RegisterDate = DateTime.UtcNow
            };
            companyRepository.Create(ownCompany).Wait();
