            {
                CompanyId = company.Id,
                Email = "user@test.com",
                FirstName = "Eldon",
                LastName = "Cutrapali",
                Phone = "+38095484688",
                Password = "333333",
                Position = "User",
                RegisterDate = DateTime.UtcNow,
                Role = UserRoles.User.ToString()
            };
            userRepository.Create(companyUser).Wait();
            User companyAdmin = new User
            {
                CompanyId = company.Id,
                Email = "admin@test.com",
                FirstName = "Eric",
                LastName = "Mure",
                Phone = "+380948685148",
                Password = "333333",
                Position = "Admin abc motors",
                RegisterDate = DateTime.UtcNow,
                Role = UserRoles.CompanyAdmin.ToString()
            };
            userRepository.Create(companyAdmin).Wait();
            User owner = new User
            {
                CompanyId = company.Id,
                Email = "owner@test.com",
                FirstName = "Shon",
                LastName = "Cooper",
                Phone = "+380648684238",
                Password = "333333",
                Position = "Owner abc motors",
                RegisterDate = DateTime.UtcNow,
                Role = UserRoles.CompanyAdmin.ToString()
            };
            userRepository.Create(owner).Wait();
            company.OwnerId = owner.Id;
            companyRepository.Update(company).Wait(); 
        }

